import React from 'react';

const NavigationBar = ({ onSafetyBoxClick, onCCTVClick, activePage }) => {
  return (
    <div className="fixed top-4 right-4 bg-white shadow-lg rounded-lg p-4 w-80">
      <div className="flex justify-between items-center mb-4">
        <h2 className="text-lg font-semibold text-gray-700">Dashboard</h2>
        <span className="text-sm text-gray-500">{activePage}</span>
      </div>
      <div className="space-y-2">
        <button 
          onClick={onSafetyBoxClick} 
          className="w-full bg-blue-50 hover:bg-blue-100 text-blue-700 px-4 py-3 rounded-lg transition-colors flex items-center justify-center"
        >
          Safety Box Information
        </button>
        <button 
          onClick={onCCTVClick} 
          className="w-full bg-green-50 hover:bg-green-100 text-green-700 px-4 py-3 rounded-lg transition-colors flex items-center justify-center"
        >
          Checking CCTV
        </button>
      </div>
    </div>
  );
};

export default NavigationBar;
